import React from "react";
import "./index.css";
import { ButtonBase } from "@material-ui/core";

function ProfileMenu({ fullName ,setDialog}) {




const logOut = ()=>{

  setDialog


}




  return (
    <div className="survival">
      <div className="chatList">
        <ButtonBase>
          <img src="./imagee/Arrow.jpg" className="imageOfProfile" />
        </ButtonBase>

        <div className="nameOf">
          <p>{fullName}</p>
        </div>
      </div>

      {/* <div className="icons">
        <div className="containerOf">
          <i class="fas fa-phone-square" id="call-icon"></i>
        </div> */}

        {/* <div>
          <i id="message-icon" class="far fa-comment-dots"></i>
        </div>
        <div>
          <i class="far fa-bell" alarm-icon></i>
        </div> */}
      {/* </div> */}

      <div className="setting">
        <div className="Organize">
          {/* <div className="icon-string">
            <i class="fas fa-cog" id="setting--icon"></i>
          </div>  */}
          {/* <div className="done">
            <p className="changeColor">Setting</p>
          </div> */}
        </div> 

        <div className="Organize">
          <div className="icon-string">
            <i class="fas fa-sign-out-alt" id="setting--icon"></i>
          </div>
          <div className="done">
            <p className="changeColor" onClick={logOut()}>Logout</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProfileMenu;
